        private static List<string> Top3(string s)
        {
            return Regex
                .Split(Regex
                    .Replace(s.ToLower(), @"(?<!\S)[^\w $]+|[^\w $']+(?!\S)|[^\w']|[_]", " "),@"[\s]+")
                .GroupBy(c => c)
                .Select(c => new { String = c.Key, Count = c.Count()})
                .Where(occurence => !string.IsNullOrWhiteSpace(occurence.String))
                .Distinct()
                .OrderByDescending(x=> x.Count)
                .Select(x=> x.String)
                .Take(3)
                .ToList();
        }
